        </Typography>
        <Typography
         sx={{color:'#1565c0',
         letterSpacing:'2px',
         fontWeight:'bold'}}
        >
            Resultant array after applying {selectedActivity && selectedActivity.label} Method: - <span style={{color:'green',letterSpacing:'3px',}}>{update}</span>

        </Typography>
        </Paper>


      </Box>
    </>
  );
}
